import React from "react";
import Navbar from "../navbar/Navbar";
import Landinghero from "../Landinghero/Landinghero";

function Landing() {
  return (
    <div className="w-full h-[100vh] flex justify-center  flex-row  bg-black">
      <Navbar />
      <Landinghero />
    </div>
  );
}

export default Landing;
